# this code is same but in this file we calculate the time how much time take the program to find the complement
# the string
import timeit

# given string
DNA_string = ' '

# this is the note the start time for program to count the time in which time program calculate the most frequent number
start = timeit.default_timer()


# this function use to complement the string
def reverseComplement(Pattern):
    # in this dict same the key and values which is complement of alphabets
    dict = {'A': 'T', 'C': 'G', 'T': 'A', 'G': 'C'}
    Reverse = ''
    # this loop to treverse the all string and complement the string and return the list
    for i in Pattern:
        Reverse += dict[i]
    return Reverse[::-1]


# function calling
print('Complementing a Strand of DNA')
print(reverseComplement(DNA_string))

# calculated time how much program is running
stop = timeit.default_timer()

print('Time: (sec) ', stop - start)
